(1, 'Storm Eowyn', 'Limerick Live Reporter24 Jan 2025 AN EIGHTY year weather record which belonged to Limerick has been smashed this morning, Met Eireann have said. Provisional figures recorded by the forecaster overnight suggest Storm Eowyn is the strongest-ever storm to pass over Ireland. Senior forecaster Gerry Murphy said the previous wind speed records - dating back to 1945 at Foynes in Limerick - have been broken. \"Storm Eowyn is an extreme storm and it has already broken records for the all-time mean wind speed and all-time gust speed for Ireland. At 4am, at Mace Head (County Galway) we had a mean speed of135km/h which breaks the previous record of 131 and at 5am, at Mace Head as well, we had a gust of 183km/h which breaks the previous record of 182\"', 'https://www.limerickleader.ie/news/weather/1711117/breaking-ireland-s-80-year-old-gust-record-recorded-in-limerick-is-broken-during-storm-eowyn.html', , 117);
